import peopleSVG from "../../images/people.svg";
import ethPSVG from "../../images/companyList/ethP.png";
import ethTSVG from "../../images/companyList/ethT.png";
import mobiSVG from "../../images/companyList/mobi.svg";
import binanceSVG from "../../images/companyList/binance.svg";
import worldEconomicSVG from "../../images/companyList/worldEconomic.svg";

const BigCompanyList = () => {
  return (
    <div className={styles.container}>
      <img src={peopleSVG} alt="" />
      <h2>Notable Satisfied Customers</h2>
